import os
import main
import unittest
import tempfile

class FlaskrTestCase(unittest.TestCase):
    def setUp(self):
        self.app = main.app.test_client()
    def test_index(self):
        response = self.app.get('/', follow_redirects = True)
        self.assertEquals(response.status, "200 OK")
    def test_Brain(self):
        response = self.app.get('/b/', follow_redirects = True)
        self.assertEquals(response.status, "200 OK")
        response = self.app.get('/b_status/', follow_redirects = True)
        self.assertEquals(response.status, "200 OK")
        response = self.app.get('/b_view/', follow_redirects = True)
        self.assertEquals(response.status, "200 OK")
    def test_upload(self): # 上傳TC的LEGO測試
        response = self.app.post('/b/test', data = {
            'user_id': '123',
            'DataURL': "data:image/png;base64,"
        }, follow_redirects = True)
        # Assert response is 200 OK.
        self.assertEquals(response.status, "200 OK")

if __name__ == '__main__':
    unittest.main()